import { HiShieldCheck } from "react-icons/hi";
import { MdCancel, MdAnalytics } from "react-icons/md";
const data = [
  {
    icon: <HiShieldCheck />,
    heading: "Best interest rates on the market",
    detail:
       "We offer the most competitive interest rates available, ensuring that you get the best deal possible. Our rates are designed to help you save money while making your investment more affordable. Trust us to provide the most attractive rates on the market."
  },
  {
    icon: <MdCancel />,
    heading: "Prevent unstable prices",
    detail:
        "We offer the most competitive interest rates available, ensuring that you get the best deal possible. Our rates are designed to help you save money while making your investment more affordable. Trust us to provide the most attractive rates on the market."
  },
  {
    icon: <MdAnalytics />,
    heading: "Best price on the market",
    detail:
      "Exercitation in fugiat est ut ad ea cupidatat ut in cupidatat occaecat ut occaecat consequat est minim minim esse tempor laborum consequat esse adipisicing eu reprehenderit enim.",
  },
];
export default data;
